import os
import re
import nltk
from nltk.corpus import stopwords
import random
import collections
from collections import Counter
import json

class Perceptron:

    def __init__(self):
        self.classes = ['DR', 'DT', 'L']
        self.failure_count = 0
        self.success_count = 0
        self.confusion_matrix = {'DR': {'DR': 0, 'DT': 0, 'L': 0}, 'DT': {'DR': 0, 'DT': 0, 'L': 0}, 'L': {'DR': 0, 'DT': 0, 'L': 0}}

        self.total_number_of_words = {}
        self.word_count_per_file_hash = collections.defaultdict(lambda: collections.defaultdict(int))
        self.feature_probability_per_file = collections.defaultdict(lambda: collections.defaultdict(int))
        self.files_per_class = collections.defaultdict(lambda: [])
        self.feature_set = set()

        self.alpha = 0.1
        self.weights = {}
        
        self.bias = {}
        self.all_files = []
        self.success_count = 0
        self.failure_count = 0

    def initiate_weights(self):
        for cl in self.classes:
            self.weights[cl] = {}
            for word in list(self.feature_set):
                self.weights[cl][word] = random.uniform(-0.5, 0.5)
            self.bias[cl] = random.uniform(-0.5, 0.5)
            self.all_files += self.files_per_class[cl]

    def preprocessing(self, doc):
        regex = re.compile('[^a-zA-Z]')

        with open(doc, encoding='utf8') as fo:
            # read in the text document as a string
            str_txt = fo.read()
            # replace non-alphabetic characters with spaces
            str_txt = regex.sub(' ', str_txt)
            # replace uppercase ascii characters with lowercase ascii characters
            str_txt = str_txt.lower().split()

            useful_words = []
            for word in str_txt:
                if word not in stopwords.words('english'):
                    useful_words.append(word)
                    self.word_count_per_file_hash[str(doc)][word] += 1

            self.total_number_of_words[str(doc)] = len(useful_words)

            # collapse multiple adjacent spaces into a single space.
            str_txt = ' '.join(useful_words)

        return str_txt

    def extract_feature_set(self):
        num_of_docs_per_class = {}
        word_counts_per_class = {}
        feature_set_per_class = {}

        # select features
        for cl in self.classes:
            i = 0
            path = os.path.join('.\data\\', cl)
            files = os.listdir(path)
            num_of_docs_per_class[cl] = sum(1 for file in files if '.txt' in file)
            word_counts_per_class[cl] = Counter()
            # There may exist files such as '.DS_Store'
            for file in files:
                if file.find('.txt') >= 0:
                    file_path = os.path.join(path, file)
                    self.files_per_class[cl].append(file_path)
                    str_txt = self.preprocessing(file_path)
                    wordCount = Counter(str_txt.split())
                    word_counts_per_class[cl] += wordCount
                i += 1

            feature_set_per_class[cl] = sorted(word_counts_per_class[cl], key=lambda x: word_counts_per_class[cl][x],
                                               reverse=True)[0:20]
            self.feature_set = self.feature_set.union(set(feature_set_per_class[cl]))

            for filename in self.word_count_per_file_hash.keys():
                for word in self.feature_set:
                    self.feature_probability_per_file[filename][word] = self.word_count_per_file_hash[filename][word] * 1.0 / self.total_number_of_words[filename]

        self.feature_probability_per_file = json.loads(json.dumps(self.feature_probability_per_file))
        self.files_per_class = json.loads(json.dumps(self.files_per_class))

    def train_perceptrons(self):
        self.initiate_weights()
        i = 0
        while i < 2000:
            for cl in self.classes:
                for file in self.files_per_class[cl]:
                    sum_val = self.bias[cl]
                    for word in self.feature_set:
                        sum_val += self.weights[cl][word] * self.feature_probability_per_file[file][word]
                    if sum_val < 0:
                        error = 1
                        for word in self.weights[cl].keys():
                            self.weights[cl][word] += (self.alpha * error * self.feature_probability_per_file[file][word])
                        self.bias[cl] += (self.alpha * error)

                for file in list(set(self.all_files) - set(self.files_per_class[cl])):
                    sum_val = self.bias[cl]
                    for word in self.feature_set:
                        sum_val += self.weights[cl][word] * self.feature_probability_per_file[file][word]
                    if sum_val >= 0:
                        error = -1
                        for word in self.weights[cl].keys():
                            self.weights[cl][word] += (self.alpha * error * self.feature_probability_per_file[file][word])
                        self.bias[cl] += (self.alpha * error)

            self.alpha *= 0.99
            i += 1

    def test(self, file_path):
        str_txt = self.preprocessing(file_path)
        file_sz = len(str_txt)
        word_counter = Counter(str_txt)
        feature_probability = {}
        for word in self.feature_set:
            feature_probability[word] = word_counter[word] * 1.0 / file_sz

        classes = []
        for cl in self.weights.keys():
            sum = self.bias[cl]
            for word in self.feature_set:
                sum += feature_probability[word] * self.weights[cl][word]
            if (sum >= 0):
                classes.append(cl)

        return classes

    def run_test_suite(self):
        path = os.path.join('./data/', 'test-results.txt')
        multiple_results = 0
        with open(path, encoding='utf8') as f:
            file_content = f.read()
            lines = file_content.split("\n")
            for line in lines:
                filename,actual_class = line.split(",")
                result = self.test(".\\data\\TEST\\"+filename.strip())
                if len(result) > 1:
                    print("multiple classes assigned to", filename, "-", "actual class", actual_class, result)
                    multiple_results += 1

                prediction = random.choice(result)
                if actual_class == prediction:
                    self.success_count += 1
                    self.confusion_matrix[actual_class][actual_class] += 1
                else:
                    self.failure_count  += 1
                    self.confusion_matrix[actual_class][prediction] += 1
        print("total ambiguous result count - ", multiple_results)

    def print_metrics(self):
        print("correct classification - ", self.success_count)
        print("incorrect classification - ", self.failure_count)
        print("accuracy - ", self.success_count*1.0/(self.success_count+self.failure_count), "\n")
        print("\t\t"+self.classes[0]+"\t\t"+self.classes[1]+"\t\t"+self.classes[2]+"\n")
        for i in range(3):
            line = self.classes[i]
            for j in range(3):
                line += "\t\t" + str(self.confusion_matrix[self.classes[i]][self.classes[j]])
            print(line+"\n")

    def classify(self):
        # found using the above step
        #self.extract_feature_set()
        #self.train_perceptrons()
        self.use_saved_training_params()
        self.run_test_suite()
        self.print_metrics()


